import react from "react";
import emailjs from "emailjs-com";
import "./Contacts.css";

const Contacts = () => {
  const sendEmail = (e) => {
    if (!e.target.value.trim().isEmpty()) {
      e.preventDefault();

      emailjs
        .sendForm(
          "service_vv2kjlg",
          "template_5otsvo5",
          e.target,
          "user_TGO8LuzN2nq1EoX5pkLUU"
        )
        .then(
          (result) => {
            console.log(result.text);
          },
          (error) => {
            console.log(error.text);
          }
        );
      e.target.reset();
    }
  };

  return (
    <div id="contacts">
      
    </div>
  );
};

export default Contacts;
